  state = {
    persons: [
      { name: 'Arya', age: 18 },
      { name: 'Jon Snow', age: 24 }
    ]
  }
  render() {
  return (
    <div className="App">
      <h1>Hello darling</h1>
      <button></button>
      <Person name = 'Arya' age = '18'/>
      <Person name = {persons[1].name} age = {persons[1].age}>My hobby: Learning</Person>
    </div>
  );
}
}

export default App;
